// import axios from "axios";
import React from "react";
import NewRouter from './routers/index.jsx'
import { HashRouter, useNavigate } from "react-router-dom";
// // // import axios from "axios";
// import ImageUploader from "./pages/ImageUploader";
// import Pdf from './pages/PDFview';
// import pdf from "./utils/wnj.pdf"
// import MyRouter from "./utils/router";

function App(){
//   onload(){
// sssss
//   }
    // const [pdf]=  ""
    const navigate = new useNavigate()
    return (
        
            <div>
            <button onClick={()=>{navigate('/ImageUploader')}}>ImageUploader</button>
            <button onClick={()=>{navigate('/PDFview')}}>PDFview</button>
                <a href="/ImageUploader">ImageUploader</a>
                <a href="/PDFview"></a>
                <HashRouter>
                    <NewRouter />
                </HashRouter>
        
            </div>
    )
}
 
export default App;
